var lengthOfLongestSubstring = function(s) {
    if (s.length===0) return 0;
    let map = new Map();
    let highest=0;
    for (let i=0, j=0; i<s.length; ++i){
        if (map.has(s.charAt(i))) {
            j = Math.max(j,map.get(s.charAt(i))+1);
        }
        map.set(s.charAt(i), i);
        highest = Math.max(highest,i-j+1);
    }
    return highest;
}


